var c=()=>{$.busyLoadFull("show",{background:"#5e626b",spinner:"circles",animation:"slide"}),Shiny.addCustomMessageHandler("app-ready",l=>{setTimeout(()=>{$.busyLoadFull("hide")},1e3)}),Shiny.addCustomMessageHandler("update-dashboard-zoom",l=>{$(l.id).css("zoom",l.zoom)}),Shiny.addCustomMessageHandler("select-scoutbar-page",l=>{let b;switch(l.value){case"links":b=0;break;case"serialize":b=1;break}$(".scoutbar-cell-item")[b].click()})};$(function(){c()});
